using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// The UIPageViewControllerDataSource protocol is adopted by an object that provides view controllers to the page view controller on an as-needed basis, in response to navigation gestures.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIPageViewControllerDataSourceProtocolRef/index.html#//apple_ref/occ/intf/UIPageViewControllerDataSource"/>    [iOSVersion(5)]    public interface UIPageViewControllerDataSource//: NSObjectProtocol    {        /// <summary>        /// Returns the view controller before the given view controller. (required)        /// </summary>        /// <param name="pageViewController">The page view controller</param>        /// <param name="viewControllerBeforeViewController">The view controller that the user navigated away from.</param>        [iOSVersion(5)]        [Export("pageViewController")]        UIViewController PageViewController(UIPageViewController pageViewController, UIViewController viewControllerBeforeViewController);                /// <summary>        /// Returns the view controller after the given view controller. (required)        /// </summary>        /// <param name="pageViewController">The page view controller</param>        /// <param name="viewControllerAfterViewController">The view controller that the user navigated away from.</param>        /// <param name="NAME_YOUR_PARAMS">DO NOT USE THIS PARAMETER - Instead make sure to name the parameters you're using.</param>        [iOSVersion(5)]        [Export("pageViewController")]        [IgnoreParameter("NAME_YOUR_PARAMS")]        UIViewController PageViewController(UIPageViewController pageViewController, UIViewController viewControllerAfterViewController, bool NAME_YOUR_PARAMS = false);                /// <summary>        /// Returns the number of items to be reflected in the page indicator.        /// </summary>        /// <param name="pageViewController">The page view controller.</param>        [iOSVersion(6)]        [Export("presentationCountForPageViewController")]        int PresentationCountForPageViewController(UIPageViewController pageViewController);                /// <summary>        /// Returns the index of the selected item to be reflected in the page indicator.        /// </summary>        /// <param name="pageViewController">The page view controller.</param>        [iOSVersion(6)]        [Export("presentationIndexForPageViewController")]        int PresentationIndexForPageViewController(UIPageViewController pageViewController);    }}